import "./App.css";

import axios from "axios";
import { useState } from "react";
import { useEffect } from "react";

function App() {
  const baseUrl = "http://localhost:50944/api/dcandidate";

  const [data, setData] = useState([]);

  const getRequest = async () => {
    await axios
      .get(baseUrl)
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    getRequest();
  });

  return (
    <div className="App">
      <br />
      <h3>Cadastro de Doação</h3>
      <header>
        <button className="btn btn-success">Adicionar novo cadastro</button>
      </header>
      <div className="form-group">
        <label>Nome:</label>
        <br />
        <input type="text" className="form-control" />
        <br />
        <label>Email:</label>
        <br />
        <input type="text" className="form-control form-select-lg mb-3" />
        <br />
        <select name="" id="" className="form-select">
          <option seleted>Blood Group</option>
          <option value="1">A+</option>
          <option value="1">A+</option>
          <option value="1">A+</option>
          <option value="1">A-</option>
          <option value="1">B+</option>
          <option value="1">B-</option>
          <option value="1"></option>
          <option value="1">A+</option>
          <option value="1">A+</option>
        </select>

      </div>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Id</th>
            <th>Nome</th>
            <th>Telefone</th>
            <th>Tipo sanguíneo</th>
            <th></th>
          </tr>
        </thead>
        <tbody> 
          {data.map(dcandidate => (
            <tr key={dcandidate.id}>
              <td>{dcandidate.id}</td>
              <td>{dcandidate.fullName}</td>
              <td>{dcandidate.mobile}</td>
              <td>{dcandidate.bloodGroup}</td>
              <td>
                <button className="btn btn-primary">Editar</button>
                <button className="btn btn-danger">Excluir</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
